cy.get('[for="password"]').type('password_2020');
cy.get('#password').should('have.value', 'password_2020');
cy.get('#join-form-submit').contains('Agree & Join').click({
  force: true
});
cy.get('.join-form__form-body').should('be.visible');
cy.get('#first-name').type('Testing');
cy.get('#last-name').type('test');
cy.get('#join-form-submit').contains('Continue').click();
cy.get('.alert').should('be.visible').contains('Someone’s already using that email.');

